roduct still cashed in with his 284 scrimmage yards and two scores. His positional eligibility will be revisited after the Week 11 slate, but he offers tremendous upside with his rushing acumen heading into a matchup against the Broncos.\",\"title\":\"Effective in starting QB debut\"},{\"timeEpochMilli\":\"1606060026000\",\"contents\":\"New Orleans Saints quarterback Taysom Hill was confirmed as the starting signal-caller by head coach Sean Payton ahead of the Week 11 contest with the Falcons. In typical Payton fashion, New Orleans waited until two hours before kickoff to officially announce the starter, but the mind games are finally over. Reports had suggested that Hill would be the starter, though it's always nice to get the official word. It's anyone's guess how the 30-year old will do, as he's very unproven as a passer. ...\",\"url\":\"https://www.rotoballer.com/player-news/taysom-hill-confirmed-as-starting-quarterback/806713\",\"title\":\"Taysom Hill Confirmed As Starting Quarterback\"}],\"nameFirst\":\"Taysom\",\"nameLast\":\"Hill\",\"proTeam\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"positionEligibility\":[\"QB\",\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6304,\"away\":{\"abbreviation\":\"ATL\",\"location\":\"Atlanta\",\"name\":\"Falcons\"},\"home\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":9,\"homeScore\":24,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":78.26087,\"formatted\":\"18/23\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":233.0,\"formatted\":\"233\"}},{\"catego